import React, { useEffect, useState } from "react";
import axios from "axios";
import "./App.css";

const App = () => {
  const [student, setStudent] = useState([]);
  const loadStudent = () => {
    axios.get("http://localhost:5000/api/getInfo?limit=10").then(({ data }) => {
      const allStudent = [];
      data.forEach((s) => {
        allStudent.push({ name: s.email, email: s.name });
      });
      setStudent(allStudent);
    });
  };
  useEffect(() => {
    loadStudent();
    console.log(student);
  }, []);
  return (
    <div>
      <h1>Hi</h1>
    </div>
  );
};

export default App;
